import React from "react";
import {Link} from 'react-router-dom';
import FavouriteButton from "./FavouriteButton.js";
import ViewButton from "./ViewButton.js"

const PlayMatches = (props) => {
    const handleHeaderClick = (e) => {

    }

    if (props.plays) {
        return (
            <div className="container">
                <h1>List/Matches</h1>
                <table>
                    <thead>
                        <tr>
                            <th>Title</th>
                            <th>Year</th>  
                            <th></th>
                            <th></th>
                        </tr>
                    </thead>
                    <tbody>
                    {props.plays.map((p) => 
                        <tr key={p.id}>
                            <td>{p.title}</td>
                            <td>{p.likelyDate}</td>
                            <td><FavouriteButton play={p} addToFavourites={props.addToFavourites}/></td>
                            <td><Link to="/play-detail"><ViewButton play={p} setCurrentPlay={props.setCurrentPlay}/></Link></td>
                        </tr>
                    )}
                    </tbody>
                </table>
            </div>
        );
    }
    else {
        return null;
    }
};

export default PlayMatches
